INSERT INTO `letter` (`id`, `no`, `lamp`, `hal`, `kpd`, `main_1`, `main_2`, `main_3`, `sign_1`, `name_1`, `sign_2`, `name_2`, `sign_3`, `name_3`, `sign_4`, `name_4`, `note`, `ket`) VALUES
(8, '02.017/SU/SMPT-BGL/VIII/2022', '-', 'Undangan Upacara Bendera', 'Yth. ', 'Dalam rangka memperingati Hari Kemerdekaan Republik Indonesia yang ke-77 dengan tema \"Pulih Lebih Cepat Bangkit Lebih Kuat\" maka kami mengundang Bapak/Ibu/Saudara/i untuk bisa menghadiri Upacara Bendera yang akan diselenggarakan pada;', 'Hari/Tanggal   : Rabu, 17 Agustus 2022\r\nWaktu              : 08.00 s.d. selesai\r\nTempat            : SMP Terpadu Bugelan', '', 'Sekretaris', 'Suci Nuramanatillah', 'Kepala Sekolah', 'Asep Irfan Helmi, S.T.', 'Ketua Pelaksana Kegiatan/ IPB', 'Abdul Munib', 'DKM Bugelan', 'Acep Helmi, S.Pd.I', 'Untuk kelangsungan acara ini diharapkan setiap RT mengirimkan 3 orang perwakilan.', ''),
(9, '02.301/SB/SMPT-BGL/XI/2022', '-', 'Surat Pemberitahuan', 'Yth. Orang tua Murid', 'Bersamaan dengan ini kami beritahukan bahwa siswa dan siswi SMPT Bugelan akan mengadakan kegiatan MABIT (Malam bina Iman dan Taqwa) dengan tema Pelatihan Fiqih Thoharoh dan Sholat, yang insya Allah akan diselenggarakan pada:', '26-27 November 2022\r\ndi Masjid Bugelan\r\nSabtu, Pkl. 15.00 s.d. Ahad, Pkl. 07.00', 'Demikian surat pemberitahuan ini kami sampaikan, mohon dukungan orang tua untuk membantu ananda supaya bisa mengikuti acara tersebut', 'Kepala Sekolah', 'Asep Irfan Helmi, S.T.', 'DKM Bugelan', 'Acep Helmi, S.Pd.I', '', '', '', '', 'Mohon kesediaan orang tua untuk bisa mengantar makan malam ananda di waktu Maghrib', ''),
(10, '01.017/ST/Y-BGL/IV/2023', '-', 'Surat Permohonan Izin', 'Yth. Kepala SD Sukasari', 's', '', '', 'Kepala SMPT Bugelan', 'Asep Irfan Helmi, S.T.', '', '', '', '', '', '', '', '');
